    getProducts();
  }, []);
  const getProducts = async () => {
    try {
      const res = await axios.get("http://127.0.0.1:1214/api/products/users");
      setData(res.data.users);
    } catch (e) {
      console.log(e.response.data.Message);
    }
  };
  return (
    <>
     {data.map(x=>{
      return(
        <>
        <div className="container">
          <div className="row">
            <div className="col-md-4"></div>
          </div>
        </div>
        </>
